import React, {Component} from 'react';
import Grid from '@material-ui/core/Grid';
import CardMedia from './CardMedia';
import {Storage} from 'aws-amplify';


class Dashboard extends Component {

    getPhoto(){
        Storage.get('example2.png', {
            bucket: 'myapp-20181030214040-deployment'
          })
          .then(result => console.log(result))
          .catch(err => console.log(err));
    }


    state = {
        persons: [],
        title: "",
        description: "",
        image_src:  ""
    }

    componentDidMount(){
        axios.get(`https://jsonplaceholder.typicode.com/users`)
        .then(res => {
          const persons = res.data;
          this.setState({ persons });
          console.log(res.data);
        })
    }

    render() {
        return(
            <Grid container spacing={16}>
            <Grid item xs={12}>
              <Grid container justify="flex-start" spacing={Number(16)}>
                {[0, 1, 2,3,4].map(value => (
                  <Grid key={value} item>
                    <CardMedia title="Dog" 
                               description="This is a dog"
                               src="https://images.pexels.com/photos/356378/pexels-photo-356378.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940"/>
                  </Grid>
                ))}
              </Grid>
            </Grid>
          </Grid>
        ) 
    }

}

export default Dashboard;
